import React from 'react';
import Card from '../UI/Card';


const Items = (props) => {
  return (
    <li>
      <h2>{props.title}</h2>
      <h3>{props.price}</h3>
      <p>{props.brand}</p>
    </li>
  );
};

export default Items;
